import React from 'react';

import SearchBar from './SearchBar';

import MainIcon from '../images/main-icon.png';

export default function Nav () {
    return (
    <nav>
        <img src={MainIcon} className='main-icon'/>
        <p>BookShelf</p>
        <SearchBar />
    </nav>
    );
}
